(defn filter-buffer! [image _mod]
  (let [ total (* 3 (.total image))
         bytes (byte-array total)]
         (.get image 0 0 bytes)
         (doseq[^int i (range 0 total)]
          (if (not (= 0 (mod (+ i _mod) 3)))
            (aset-byte bytes i 0)))
        (.put image 0 0 bytes)
        image))



(->
  "resources/chapter02/emilie1.jpg"
