(defn apply-custom-kernel [ src target matrix ]
  (let [kernel (u/matrix-to-mat matrix)]
    (filter-2-d src target -1 kernel)))

(defn apply-custom-kernel! [ src matrix ]
  (let [target (u/mat-from src)
        kernel (u/matrix-to-mat matrix)]
    (filter-2-d src target -1 kernel)
    target))
